import React from 'react';
import {Container, Nav, Navbar} from "react-bootstrap";

const Header = () => {
        return (
            <Navbar fixed="top" expand="lg" bg="dark">
                <Container>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav"/>
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="me-auto">
                            <Nav.Link href="/">Главная</Nav.Link>
                            <></>
                            <Nav.Link href="/request">Запросы</Nav.Link>
                            <Nav.Link href="/new-employee">Регистрация нового сотрудника</Nav.Link>
                            <Nav.Link href="/new-manager">Регистрация нового менеджера</Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        );
}

export default Header;
